import React from "react";
import { Link } from "react-router-dom";
import "./../assets/styles.css";

const Navbar = () => {
    return (
        <nav style={{ background: "rgba(0, 0, 0, 0.7)", padding: "10px 20px", borderRadius: "10px" }}>
            <ul style={{ display: "flex", justifyContent: "space-around", listStyle: "none", padding: 0 }}>
                <li><Link to="/events" style={{ color: "#fff", textDecoration: "none" }}>Events</Link></li>
                <li><Link to="/attendees" style={{ color: "#fff", textDecoration: "none" }}>Attendees</Link></li>
                <li><Link to="/tasks" style={{ color: "#fff", textDecoration: "none" }}>Tasks</Link></li>
            </ul>
        </nav>
    );
};

export default Navbar;
